import React, { Component } from 'react';

class App extends Component {
	state = {
		messages: []
	};
  render() {
    return (
    	<div>
    		<div>
    			{this.state.messages}
    		</div>
    		<input type="text" onChange={ ({target}) => this.setState({message: target.value}) } />
    		<button onClick={e => {
    			e.preventDefault();
    		}} />
    	</div>
    )
  }
}

export default App;
